import React from 'react';

 export default async function envialogin(item){
    const cargoUtil = JSON.stringify({profile: item});
    alert(cargoUtil);
    return await fetch("http://localhost/IniciaSessio.php", {
        method:'post',
        headers: {
            "Content-Type": "application/json"
        },
        body: cargoUtil
    }).then((res)=>res.json()
    ).then((res)=>console.log(res))
}
